import React from 'react'
import { Row } from 'react-bootstrap'
import CardMovie from './CardMovie'

export default function MoviesList({movies}) {
  return (
    <Row className='mt-3'>
        {movies.length >=1 ?(movies.map((mov)=>{
          return (<CardMovie mov/>)  
        })):<h1>Not found movies</h1>}
    </Row>
  )
}
